import React from 'react';

const Map = () => {

    const mapRef = React.useRef()

    var map = new ol.Map({
        target: 'map',
        layers: [
            new ol.layer.Tile({
                source: new ol.source.OSM()
            })
        ],
        view: new ol.View({
            center: ol.proj.fromLonLat([37.41, 8.82]),
            zoom: 4
        })
    });

    return(
        <div className="map-screen">
            <div id="map-view" className="map-view" ref={mapRef} height="600px" width="850px">
                
            </div>
        </div>
    )
}
export default Map;
